css:
.header-view {
  position: fixed;
  width: 100%;
  z-index: 10;
  position: relative;
}
.header-view .heading-close {
  color: #ffffff;
}
.header-view .heading-title {
  padding-left: 6px;
}
.header-view .heading-status {
  padding-left: 9px;
}
.header-view .icon-alert {
  color: #e9c062;
}
.header-view .icon-check {
  color: #a8ff60;
}
.header-view .icon-hourglass {
  color: #a3a5a5;
}
.header-view .icon-stop {
  color: #cc6666;
}
.script-view {
  overflow: scroll;
  max-height: 300px;
  height: auto;
  margin-bottom: 0px;
}
.script-view .panel-body pre {
  background: #141516;
  color: #a3a5a5;
}
.script-view .stderr {
  color: #cc6666;
}
.script-view .line {
  border-radius: 0px;
  margin: 0px;
  padding: 0px;
}
